import React, { Component } from "react";
import Weather from "./Weather";

class Find extends Component {
  render() {
    return (
      <React.Fragment>
        <h1>Find</h1>
        <Weather city={this.props.match.params.id} />
      </React.Fragment>
    );
  }
}

export default Find;
